import { LEVELS } from "./levels";

export class Task {
    name =  '';
    description = '';
    completed = true ;
    level = LEVELS.NORMAL;

    constructor (name, description, completed, level) {
        this.name = name;
        this.description = description;
        this.completed = completed;
        this.level = level;
    }
}
